import React from "react";
import About from "../About";
import CallToAction from "../CallToAction";
import Motto from "../Motto";
import Client from "../OurClient";
import OurServices from "../OurServices";

function Main(){
    return(
        <main id="main">
            <About/>
            <Client/>
            <Motto/>
            <OurServices/>
            <CallToAction/>
        </main>
    )
}

export default Main;
